  return <StyledBox textTransformStyle={textTransform} ellipsis={ellipsis} className={clsx({
    [className || ""]: true
  })} component="p" mb={0} mt={0} fontSize="14px" {...props}>
      {children}
    </StyledBox>;
};
export const Small = ({
  children,
  className,
  ellipsis,
  textTransform,
  ...props
}) => {
  return <StyledBox textTransformStyle={textTransform} ellipsis={ellipsis} className={clsx({
    [className || ""]: true
  })} component="small" fontSize="12px" fontWeight="500" lineHeight="1.5" {...props}>
      {children}
